import React from 'react';
import ford from "./image/voiture_ford_1.jpg"
import { useEffect, useState } from 'react';

const VoituresData = () => {

    const [voituresData, setVoituresData] = useState([]);

    useEffect(() => {
        setVoituresData([
            { id: 1, name: "ford", image: ford },
            { id: 2, name: "ford", image: ford },
            { id: 3, name: "ford", image: ford },
            { id: 4, name: "ford", image: ford },
            { id: 5, name: "ford", image: ford },
            { id: 6, name: "ford", image: ford },
            { id: 7, name: "ford", image: ford },
            { id: 8, name: "ford", image: ford }
        ]);
    })

    localStorage.setItem('listeImageVoiture', voituresData);
    console.log(voituresData);

    return (
        <div>
            {voituresData.map((photo) => {
                return <img key={photo.id} src={photo.image} />;
            })}
        </div>
    );
};

export default VoituresData;
